import React from 'react';

function Message({ text, isBold }) {
  return (
    <div className="message">
      <p style={{ fontWeight: isBold ? 'bold' : 'normal' }}>{text}</p>
      <span className="timestamp">2:00pm</span>
    </div>
  );
}

export default Message;
